$(function(){
  // Audio
  try {
    var testaudio = new Audio("");
    if(testaudio.canPlayType){
      var canPlayOgg = ("" != testaudio.canPlayType("audio/ogg"));
      var canPlayMp3 = ("" != testaudio.canPlayType("audio/mp3"));
      if(canPlayOgg){
        var seData = "data:audio/ogg;base64,";
      }else if(canPlayMp3){
        var seData = "data:audio/mp3;base64,";
      }else{
        window.alert('お使いのブラウザはogg,mp3をサポートしていないため、ラジへぇへ参加することができません。別のブラウザでご利用ください。');
        throw "oggもmp3もサポートしていません";
      }
    }else{
      throw "canPlayTypeメソッドが存在しません";
    }
  } catch (e) {
    testaudio = null;
    window.alert('お使いのブラウザはHTML5 Audioをサポートしていないため、ラジへぇに参加することができません。別のブラウザでご利用ください。');
  }


  //// Handlers for UI
  // 自分が「へぇ」ボタンを押した
  $('#he-button').bind('click', function(){
    socket.emit('hey');
    new Audio(seData).play();
  });


  //// Handlers for WebSocket
  // 他のユーザが「へぇ」ボタンを押した
  socket.on('hey-from-another', function(){
    console.log('hey-from-another');
    new Audio(seData).play();
  });
  // 他のユーザが接続した
  socket.on('another-connected', function(){
    console.log('Another user has been connected.');
  });


});
